import React from 'react';
import FacebookLogin from 'react-facebook-login'

class Facebook extends React.Component {
   constructor(props) {
       super(props);

       this.state = {
           isLoggedIn: false,
           userID: '',
           name: '',
           email: '',
           picture: ''
       };
   }

   responseFacebook = response => {
       console.log(response);
       this.setState({isLoggedIn: true});
   };

